import React from 'react';

import { useAppContext } from '../Context/AppContext'
import { HomeLists } from '../Components/HomeLists/HomeLists';



function Home() {
  const value = useAppContext();

  return (
    <div className='container'>
      {
       value.store.characters.lenght != 0 
       ? <HomeLists />
       :<h1>Loading...</h1>
      }
      
    </div>
  );
}

export default Home;
